			{
				type = ObjType.Number;
				this.value = value;
				this.parser = parser;
			}
			
			public ExprStackObject(bool value, NinjaParser parser)
			{
				type = ObjType.Number;
				this.value = value;
				this.parser = parser;
			}
			
			public dynamic Calc()
			{
				if (type == ObjType.Number)
					return value;
				if (type == ObjType.Var)
				{
					return parser.FindVar(value).value;
				}

				Error("\"" + value + "\" is an operation");
				return null;
			}
			
			public new Type GetType()
			{
				VarType type = parser.FindVar(value).type;
	        	switch (type)
	        	{
	        		case VarType.Int:
		        		return typeof(int);	
	        		case VarType.Double:
	        			return typeof(double);		
	        		case VarType.Bool:
	        			return typeof(bool);
				}
				Error("Variable " + value + " has an unknown type");
	        	return null;
	        }
		}
		
